INSERT INTO `report` VALUES (101,'GUI unique e-mails','select email,created,count(email) as no from frontend where created>\'2015-01-01\' group by email order by created desc',NULL,100),(102,'GUI activity','select left(created, 7) as Month, count(*) as `Events` from frontend where created>\'2015-01-01\' group by year(created)*12+month(created) order by created','https://chart.googleapis.com/chart?cht=lc&chs=500x250&chd=t:{Events}&chl=Events',200),(103,'GUI versions per month','select left(created, 7) as Month, coreFullVersion as Version, count(*) as `no` from frontend where created>\'2015-01-01\' group by year(created)*12+month(created),coreFullVersion order by created;',NULL,300),(104,'Maven downloads per month','select left(timeStamp, 7) as Month, sum(`count`) as `Downloads` from `usage` group by left(timeStamp, 7) order by timeStamp','https://chart.googleapis.com/chart?cht=lc&chs=500x250&chd=t:{Downloads}&chl=Downloads&chxl=0:{Month}',NULL),(105,'Maven downloads per month detailed','select left(timeStamp, 7) as Month, artifact as Artifact, sum(`count`) as `Downloads` from `usage` group by left(timeStamp, 7), artifact order by timeStamp',NULL,NULL),(106,'GUI new e-mails per day','select left(created, 10) as Day, count(no) as no from ( select email,created,count(email) as no from frontend where created>\'2015-01-01\' group by email) as T group by day(created) order by created;','https://chart.googleapis.com/chart?cht=lc&chs=500x250&chd=t:{no}&chl=New users',NULL);
